    def findMaxAverage(self, nums: List[int], k: int) -> float:
        """
        Reference from : https://leetcode.com/problems/maximum-average-subarray-i/solutions/173107/python-solution/?envType=study-plan-v2&envId=leetcode-75
        """
        summ = sum(nums[:k])
        maximum = summ

        for i in range(1, len(nums)-k+1):
            summ -= nums[i-1] # 減掉前一個
            summ += nums[i+k-1] # 加上後一個
            maximum = max(maximum, summ)

        return float(maximum) / k

    def findMaxAverage_20250903(self, nums: List[int], k: int) -> float:
        sumList = [sum(nums[0:k])]
        num = 0
        for i in range(k, len(nums)):
            count = sumList[-1] - nums[num] + nums[i] 
            sumList.append(count)
            num += 1
        maxValue = max(sumList)
        return  maxValue / k


